import React from 'react';

const CharacterDetails = (props) => {
    return(
        <div>
            <img src={props.results.image}
                 alt={props.results.name}
            />
            <h3>{props.results.name}</h3>
            <p>{props.results.species}</p>
            <p>{props.results.name} appears in {props.results.episode.lenght} episodes.</p>
            <p>Status: {props.results.status}</p>
        </div>
    )
}

export default CharacterDetails;
